@DaviesAntiques That mixed metal type of work looks more Islamic to me.
That would of been my first instinct,
You often see A&amp;C style motifs and Celtic knot work design on those types of pieces.

@hill13_graham Luckily I’d seen the imagery before, and I actually had a brooch that matched the design a couple of years ago (I think the brooch was 1990’s).
Someone has obviously seen it and made a piece in the style of.
Yours looks more handmade than mine did though.

@strangecurios @eBay_UK It’s been a long held (conspiracy?) theory that eBay favour the Chinese market, on account of the business they put eBay’s way.
I’ve heard all sorts, including blackouts where your items aren’t visible or shunted way down the pecking order.
Who knows what’s actually true!

@fleurdechair I absolutely agree with you. 
They’ve messed around the categories, endlessly trying to fine tune what didn’t need fine tuning.
For me, it’s not working.

@donald_hyne There’s certainly something going on, Don.
Even if you put a desirable item up at a silly price, you’ll still get watchers because folks are curious.
That doesn’t seem to be happening now, it’s weird.

@GaddClaude @eBay I’d love to know the rational behind these decisions.
They’ve culled many categories, notably the period styles ones (art nouveau, deco etc).
It wasn’t broken so why did they have to fix it?

@ye_shoppe I’d say it’s almost certainly English.
I’ve seen the Green man and bird pattern on silver items a number of times on English late Victorian or Edwardian silver.
See example… https://t.co/NDdMb6YxS7
